export function addSprite(sprite){
  return {
    type:'ADD_SPRITE',
    payload:{sprite,uniqueKey}
  }
}

export function selectSprite(uniqueKey){
  return {
    type:'SELECT_SPRITE',
    uniqueKey
  }
}
